import React ,{ useState } from "react";
import {Table} from 'reactstrap';
import './App.css';
import {FaDeskpro} from 'react-icons/fa';
import { CircularProgress } from "@material-ui/core";
var link=["https://reqres.in/api/users?page=1","https://reqres.in/api/users?page=2"];
var i=0;
const App=()=>{
  const [users,setUsers]=useState([]);
  const [preload,loading]=useState(false);
  const load=() =>
  { 
    loading(true);
    fetch(link[i])
    .then((response) => response.json())
    .then((json) => {
      console.log(json.data)
      setUsers(json.data); // Prints result from `response.json()` in getRequest
    });
    i>=1?i=0:i++;
    setTimeout
    (()=>
      {loading(false);},300
    );
  };
  return (
    <div className="App">
      <header>
        <nav class='navbar'>
        <button onClick={load}>GET USERS</button>
        <span><FaDeskpro />ZIGZAG</span>
        </nav>
       </header>
    <div class="cred">
      {users.map((data) => {
            return (
              <div className='card'>
                <img src={data.avatar} alt='profilepic' class="propic"></img>
                <Table>
                <tr>
                  <td>FIRST NAME</td>
                  <td>{data.first_name}</td>
                </tr>
                </Table>
              </div>
            );
          })}
      </div>
    </div>
  );
}
export default App;
